import { useState, useEffect } from 'react';
import './App.css';


function App() {

  const [deprem, setDeprem] = useState("");

  useEffect(() => {
    fetch('https://api.orhanaydogdu.com.tr/deprem/live.php?limit=100')
      .then(response => response.json())
      .then(data => {
        setDeprem(data);
      });
  }, []);

  console.log(deprem)
  return (
    <div>
      <h1>Deprem</h1>
      <ul>
        {deprem.map((deprems) => (
          <li key={deprems.id}>
            <h2>{deprems.title}</h2>
            <p>{deprems.date}</p>
            <p>{deprems.time}</p>
            <p>{deprems.location}</p>
            <p>{deprems.magnitude}</p>
            <p>{deprems.depth}</p>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default App;
